import React, { useState, useEffect } from "react"
import "./Right.css"
import Snippet from "./Snippet"
import fuzzy from "fuzzy"
import Request from "./Request/index.jsx"
import SnippetTopBar from "./SnippetTopBar"
import SnippetSearchBar from "./SnippetSearchBar"
import NewSnippetButton from "./NewSnippetButton"

function Right(props) {
	const [searchTerm, setSearchTerm] = useState("")
	const [searchResults, setSearchResults] = useState(props.snippets)

	useEffect(() => {
		const searchResult = fuzzy.filter(searchTerm, props.snippets, {
			extract: (el) => el.text,
		})

		const results = searchResult.map((el) => el.original)
		setSearchResults(results)
	}, [props.snippets, searchTerm])

	const handleDrop = (e) => {
		e.preventDefault()

		const parameters = {
			data: { text: e.dataTransfer.getData("text") },
			method: "POST",
		}
		const snippetsRequest = new Request("snippets/", parameters)
		snippetsRequest
			.then((res) => {
				props.setSnippets([...props.snippets, res.data])
			})
			.catch((err) => {
				console.log(err)
			})
	}

	const handleOnPaste = (e) => {
		const text = e.clipboardData.getData("text")
		const parameters = {
			data: { text: text },
			method: "POST",
		}

		const snippetsRequest = new Request("snippets/", parameters)
		snippetsRequest
			.then((res) => {
				props.setSnippets([...props.snippets, res.data])
			})
			.catch((err) => {
				console.log(err)
			})
	}

	const handleDragOver = (e) => {
		e.stopPropagation()
		e.preventDefault()
	}

	const handleDragEnter = (e) => {
		e.preventDefault()
	}

	return (
		<div
			className="right"
			onDragOver={(e) => handleDragOver(e)}
			onDrop={(e) => handleDrop(e)}
			onDragEnter={(e) => handleDragEnter(e)}
			onPaste={(e) => handleOnPaste(e)}
		>
			<SnippetTopBar> </SnippetTopBar>
			<SnippetSearchBar
				onChange={(e) => setSearchTerm(e.target.value)}
			></SnippetSearchBar>
			<NewSnippetButton
				snippets={props.snippets}
				setSnippets={props.setSnippets}
			></NewSnippetButton>

			<div className="snippet-container">
				{searchResults.map((snippet, index) => {
					return (
						<Snippet
							key={index}
							snippet={snippet}
							index={index}
							snippets={props.snippets}
							setSnippets={props.setSnippets}
						></Snippet>
					)
				})}
			</div>
		</div>
	)
}

export default Right
